Amy - Euro Humpers
Added: February 20, 2011

We invited Amy over to play some video games. Met her at the local college, and she loves American exchange students. We decided to play &quot;Strip Video Games&quot; - basically you lose, you strip. Well, we then put in Jason's favorite video game he's sick at, and let's just say he didn't lose once. At the same, I think Amy was trying to lose, or she was just that bad! Either way, another hot euro girl humped!
